import React from 'react'
import { SafeAreaView, View, Text } from 'react-native'


export default function Cadastro(){
    return(
        <SafeAreaView>
            <View>
                <Text>Tela de Cadastro</Text>
            </View>
        </SafeAreaView>
    )
}
